import{_ as t,c as a,o as l,a as e}from"./app.7586e3b1.js";const s="/st0030-01.png",S=JSON.parse('{"title":"凹语言开源1 周年直播预告！","description":"","frontmatter":{},"headers":[],"relativePath":"smalltalk/st0030.md"}'),r={name:"smalltalk/st0030.md"},p=e('<h1 id="凹语言开源1-周年直播预告" tabindex="-1">凹语言开源1 周年直播预告！ <a class="header-anchor" href="#凹语言开源1-周年直播预告" aria-hidden="true">#</a></h1><ul><li>时间：2023-08-16</li><li>撰稿：OSC开源社区</li><li>转载请注明原文链接：<a href="https://wa-lang.org/smalltalk/st0030.html" target="_blank" rel="noreferrer">https://wa-lang.org/smalltalk/st0030.html</a></li></ul><hr><p>凹语言是针对 WASM 平台设计的通用静态类型编译型语言。它是由国内的一群编程语言爱好者发起的项目，设计重点是降低使用者的心智负担。</p><p>从2018年底立项，2019年开始前期准备，2020年加入新成员，2021年项目联合发起人共同出版合著书籍《Go语言定制指南》，2022年项目正式启动并于7月20日开源，凹语言一步一个脚印，在国内的同类项目中，首个实现了浏览器内编译、执行全链路。</p><p>开源一周年之际，凹语言在8月12日发布了MVP版本，为发展提供了更多可畅享的未来，本期COSCLC社区畅聊，我们邀请了凹语言项目的联合发起人和临时决策委员会的委员，为大家介绍凹语言项目及社区，讲述在发展过程中面对困难与压力，以及采取的应对措施，针对MVP版本也进行细致说明，和大家一同展望凹语言的发展。</p><ul><li>直播主题：1 周岁发布MVP版本，凹语言有话说！</li><li>直播时间：8 月 24 日 19:00-20:30</li><li>直播平台：“OSC 开源社区”视频号</li></ul><p>直播嘉宾：</p><ul><li>项目联合发起人：柴树杉、丁尔男，合著有《WebAssembly标准入门》、《面向WebAssembly编程》、《Go语言定制指南》等专著</li><li>临时决策委员会委员：扈梦明、赵普明</li></ul><p><img src="'+s+'" alt=""></p><hr><p><strong>关于中国开源社区Landscape 社区</strong></p><p>COSCLC：中国开源社区 Landscape 社区，是以国内开源社区为单位的社区，旨在通过凝聚社区力量，推动国内开源生态发展。（COSCLC 具体章程等规划正在筹备中，近期公布。）</p><p><strong>关于《COSCLC 社区畅聊》系列直播</strong></p><p>《COSCLC 社区畅聊》系列直播由中国开源社区Landscape 社区（COSCLC）推出，把目光聚焦于开源项目背后的开源社区和开源作者，让他们来畅聊一下：自己的开源项目因何而起、经历了怎样的发展，开源作者 / 社区在开源过程中的酸甜苦辣、开源项目的运营经验...</p><p>每个开源项目的背后都有不同的故事，让我们倾听这些来自社区，来自作者的声音。</p>',16),i=[p];function n(o,_,c,C,d,h){return l(),a("div",null,i)}const g=t(r,[["render",n]]);export{S as __pageData,g as default};
